description:
L'Union des Techniciens en faveur des Jeunes Désoeuvrés (UTEFAJEDE) dispose dun centre dapprentissage de métiers spécialisés sis quartier Béa-Rex, sur lavenue Barthélémy Boganda (PK4). Avant sa destruction en octobre 2014, il accueillait une centaine de jeunes pour des formations allant de 3 à 9 mois, dans des filières très diverses comme la pâtisserie, la saponification, la menuiserie, le commerce, la couture, lélectricité, le bâtiment, la technique du froid, la mécanique auto, la soudure, la construction métallique. Aujourdhui, le projet consiste à réhabiliter le bâtiment ainsi quà réinstaller une partie des équipements pillés. Il sagira aussi pour UTEFAJEDE de prendre en charge laccueil dune première promotion dapprenants, estimé à 60 jeunes (dont au moins un tiers de filles, en particulier des filles-mères sans soutien). La présente convention financera donc :
- une partie des travaux de réhabilitation (maçonnerie, charpente, électricité, plomberie, peinture) ; 
- une partie des outillages dédiés à lapprentissage et matières consommables (poste à soudure, pompe à vide, manomètre, fours) ; 
- des sessions dinformation et de sensibilisation des potentiels bénéficiaires, ainsi des autorités locales ; 
- la remise à niveau et la réorganisation de la nouvelle équipe dencadrants et de formateurs.

Diakonia supported RDFL project "Changing Cultural &amp; Legal Perceptions &amp; Practices of Sexual Violence Against Women &amp; Girls from 2016 to 2017 while also working on enhancing RDFL's institutional capacities. This made it easy to shift from porject to program funding for the period 2018-2020 under the title "Combat all forms of violence and discrimination against women in private and public spheres.
This three-year program will contribute to Diakonia's themes of Human Rights and Gender Equality as it aims at a) advocating and promoting the fulfillment of human rights committments and b) combating GBV.
RDFL goal: The prevention of gender based violence is promoted by reducing the social acceptance, changing attitudes and improving the knowledge, practices and policies that perpetuate sexual violence against women in Lebanon.
&nbsp;
Program Objectives:
&nbsp;
O1. Protection of women from violence is expanded and strengthened at community level in five governorates in Lebanon
&nbsp;
O2. RDFL National Advocacy Campaign for the adoption of a law that ends child marriage in Lebanon is expanded.
&nbsp;

Aiming to provide immediate income opportunity and rehabilitate the community infrastructures, the project will facilitate cash forwork (CFW) activities. The priority will be given for selecting of community infrastructures which can benefit the whole community members and alleviate the negative effect of potential drought. Potential infrastructure works may include irrigation canal construction or rehabilitation, karez cleaning, water saving technologies (rain water harvesting ponds).
The project will also provide emergency, unconditional cash for food of 18,000 AFN for 192 most vulnerable households who have no family member to work due disabilityand age issues.
Proposed response
Usually in case of drought (dry spell season), affected people, communities need of emergency, early recovery and longer-term support from Government and Aid agencies.  Oxfam is proposing to use 83,048 EUR from Oxfam Novib#s 2018-2019 discretionary funding to launch the emergency cash assistance in Daykundi. Oxfam#s local partner NGO, Afghan Development Association (ADA) has operational office in Daikundi. Supporting ADA for this emergency response is in line with the requirements of Oxfam Novib#s discretionary funding utilization and contributes to Grand Bargain commitment in localization of the aid. Considering FSAC members joint assessment report recommendations and funding limitation, this project will cover Ashterlay district of Daykundi province. Oxfam and ADA will continue to explore additional external funding opportunities for drought response. The activities proposed in the framework of this project include the following:
1. Vulnerability assessment and beneficiary selection
a. Communities selection
In consultation with provincial and district authorities, cluster of Community Development Councils (CDCs), ADA will identify up to 10 communities which are most vulnerable to the upcoming drought. Key criteria for communities# selection include: lack or limited availability of income generation opportunities, higher number of population versus limited available natural resources (land, water, pasture), degradation of natural resources, predominantly agriculture areas, no other similar projects in the community toavoid overlap. ADA will coordinate the target communities# selection with other International and local NGOs to avoid the overlap.
b. Household vulnerability assessment and beneficiary selection
Through consultation with selected communities CDCs, ADA will develop the preliminary list of vulnerable households. All CDC members will be explained by ADA about the vulnerability criteria (see below in the document) for beneficiary selection, project goals and planned activities. As a second step, ADA staff will conduct an independent assessment of households from the preliminary list. To avoid fraud cases in targeting of vulnerable households, ADA field team will be trained and guided by ADA Kabul office and Oxfam on beneficiary targeting principles, processes. ADA will use smart phones for data collection with Mobenzi software which will be funded by this project. ADA team will be trained by Oxfam on how to use the data collection tool. In consultation with FSAC, Oxfam decided to use SFSA household vulnerability assessment questionnaire. Seeannex 2 # Household assessment questionnaire.
Based on households# assessment database in Mobenzi, Oxfam and ADA will select the list of final beneficiaries using the selection criteria listed below in the document. Due to limited resources, the selection criteria will not be targeting people based on their status but based on their vulnerability which may include the following:
1. Female Headed Household;
2. Child Headed Household;
3. Disabled Headed Household;
4. Elderly Headed Household;
5. Households with children under 5 with Severe Acute Malnutrition (SAM) or Moderate Acute Malnutrition (MAM);
6. Vulnerable Households with more than 3 children under five years old and/or pregnant women and/or lactating women;
7. Very Large Family (7 members or more);
8. Very Poor Families # household monthly income of no more than 5000 AFN;
9. Families with Chronically-ill members or having other pressing vulnerability;
10. Families with only one male members;
11. The families having high score in reduced Coping Strategy Index (rCSI) and low food consumption score (FCS).
Aiming to reduce the risks of fraud in beneficiary targeting, ADA Monitoring and Evaluation team will conduct pre-distribution monitoring by calling at least 10% of selected households. Furthermore, ADA will conduct awareness raising among all target communities, CDCs, beneficiaries about Oxfam#s beneficiary feedback and complaint mechanism. The project will aim to target as much as possible vulnerable female headed households and promote women#s participation. To achieve this, ADA will implement the project in a gender and culturally sensitive manner. ADA will have at least 50% female staff among all project staff members and provide training to all project staff in community, beneficiary targeting process, accountability, transparency, humanitarian principles, beneficiary protection and effective communication techniques.

2. Emergency cash assistance
Aiming to provide immediate income opportunity and rehabilitate the community infrastructures, the project will facilitate cash for work (CFW) activities. The priority will be given for selecting of community infrastructures which can benefit the whole community members and alleviatethe negative effect of potential drought. Potential infrastructure works may include irrigation canal construction or rehabilitation, karez cleaning, water saving technologies (rain water harvesting ponds). To increase the communities and beneficiaries# ownershipADA will encourage target communities to contribute with tools for CFW activities and use limited project funds for cash assistance. Aiming to ensure the quality of the community infrastructure works, ADA will employ one qualified engineer, who will train and work with target communities in site selection, BoQ (bill of quantities) development, planning and implementation of the CFW technical works. Through this project, Oxfam and ADA will provide 86 vulnerable households with conditional cash assistance of 18,000 AFN for their 36 days of work (average 500 AFN/day including 350 AFN unskilled and 650 AFN skilled labor).  The project will also provide emergency, unconditional cash for food of 18,000 AFN for 192 most vulnerable households who have no family member to work due disability and age issues. This 6000 AFN is based on the standard FSAC package of one-month food basket calculated for a household of average 7 members, providing 2,100 Kcal/person/day. Hence, 18,000 AFN will cover 3 months food needs as per FSAC recommendations. ADA willuse cash in envelope or local hawala for cash delivery mechanism considering the feasibility and risk assessment. Cash distributions will be made monthly. To avoid local market prices inflation, ADA will conduct weekly monitoring of prices for main food items in Nili, Ashterlay markets and will share the findings with Oxfam. Based on FSAC data, at this stage the assumption is that the local markets continue to function well with stable prices mainly due to supplies from major markets (Ghazni, Kabul and Kandahar markets).
Through this project, ADA will provide cash assistance to 278 households with 1,390 total individuals including 300 men, 370 women,342 boys and 378 girls

This project will allow IDRC's Canadian Partnerships program to respond to requests from local, regional, national, and international organizations based in Canada that are engaged in producing or sharing knowledge for development. The funding demonstrates IDRC's commitment to improving Canadians' understanding of global development issues that affect Canada and lower-income countries. It will help increase the knowledge and skills needed to address these issues.

The project's objectives include:
-to support Canadian institutions to undertake innovative research and knowledge-based activities;
-to strengthen capacity among Canadian institutions to potentially help inform policy and practice in Canada and in low- and middle-income countries;
-to foster collaboration across types of organizations, areas of knowledge, and geographic boundaries;
-to encourage learning activities, including: self-monitoring and assessment of activities, knowledge-sharing; and learning from others' experiences; and,
-to respond to requests from IDRC programs and regional offices to support activities involving Canadian organizations.

Through these small grants, IDRC will support Canadians interested in innovative research and knowledge-led work for international development in areas that complement and may go beyond its current thematic priorities. The activities will contribute to:
-improving collaborative research skills;
-infusing perspectives from lower-income countries into Canadian approaches to global issues; and, 
-shedding light on the changing nature of global-local relations. 

This marks the third year that the small grants will be administered through a regular competitive application process.

