RECAC # Children#s Friends Network is a non-profit organization, officially established in 2012, based on the belief that Media plays a very significant role in influencing opinion and public policies for the Promotion and Realization of Children's Rights and Human rights. With around 600 members, journalists and other communicators working with different media, whose motivation is to contribute to the advancement and promotion of children's rights, RECAC's mission is "to advocate for the realization of the Rights of the Child in Mozambique through the mass media. RECAC promotes public debates on issues related to the valorisation of Human and Child Rights, with a view to placing it on the country's development agenda, influencing decision-making powers.
RECAC has three main lines of action, namely:
The promotion of Children's Rights to Participation;
The Right to Information and the strengthening of institutional capacities;
Those  line of action  are drawn in order to achieve its  Principal objective  which is to contribute to greater awareness and accountability related to the Rights of the Child by the main actors (Government, CSO and Media). "
In order to promote the Rights of the Child to Participation and Information, RECAC has proposed to develop advocacy actions in favor of childs  social change.

  Development of the agriculture sector is crucial to economic recovery in Rwanda, a need particularly urgent in the northeastern province of Umutara. Sub-projects will be carried out in the Kabare, Muvumba and Kahi districts, as well as the municipality of Umutara, and will include the follwing: <U+FFFD>expansion and rehabilitation of four water supply conveyance systems;
<U+FFFD>rehabilitation or construction of valley dams;
<U+FFFD>drilling of cattle-watering points;
<U+FFFD>upgrading of around 177 km of feeder roads; and
<U+FFFD>provision of the tools, materials and knowledge farmers need to increase crop and livestock production.
 On completion, water supply services for around 38,000 homes will be enhanced through the project.

This project will carry out the following: <U+FFFD>construction of an 85 km-long bituminous road originating in the town of Kalabo, passing through Sikongo and then connecting to the Angolan border;
-installation of drainage works and safety features;
-construction of two bridges across the Lueti and Lyachi Rivers in Sikongo.

On completion, the improved connectivity to Angola, Zambia<U+FFFD>s major trading partner, will enhance the latter<U+FFFD>s economic growth. Zambia<U+FFFD>s rural communities will benefit from swifter, safer transport of produce and be able to reach formerly-inaccessible social services.
